function Header() {
  return (
   
      <div class="columns mt-5 is-centered" style={{
        width: "50%",
        margin: "0 auto",
        marginTop: "50px",
        paddingBottom: "70px",
      }}>
        <div class="column"style={{ 
            padding: "10px"
         }}>First column</div>
        <div class="column">Second column</div>
      </div>
  );
}

export default Header;
